if (response_iserror) {
	done();
}
let body = response_body;
let resp_body = {};
if (body['name']) {
    resp_body.name = body['name']
}
if (body['user']) {
    var user = body['user'];
    if (user['permissionId']) {
        resp_body.id = user['permissionId'];
    }
    if (user['emailAddress']) {
        resp_body.login = user['emailAddress'];
    }
}
done({
    "response_body": resp_body
})

// Google expects a unique requestId to be sent for creating team-drive
var uuId = Math.floor(Date.now() * Math.random());
var vendorQueryParam = {};
vendorQueryParam.requestId = uuId;

done({
"request_vendor_parameters": vendorQueryParam
});
